import Vue from 'vue'
import VueRouter from 'vue-router'

//安装vueRouter插件，对vue功能的扩展
Vue.use(VueRouter)

export default new VueRouter({
	routes:[
		{
			path:"/",
			redirect:'/findstu'//重定向
		},
		{
			name:"insertstu",
			path:"/insertstu",
			component: ()=> import("../views/insertstu.vue")
		},
		
		{
			name:"findstu",
			path:"/findstu",
			component: ()=> import("../views/findstu.vue")
		}
	]
});
